import{_ as A,p as s,q as p,a1 as a}from"./framework-204010b2.js";const g="/assets/image-20221010155343750-731f77ff.png",t="/assets/image-20221010155414830-061c016e.png",e="/assets/image-20221010155508084-9bad0add.png",i="data:image/png;base64,",r="/assets/image-20221010155629449-14b7fd69.png",o="/assets/image-20221010155756041-c73ae2e5.png",n="/assets/image-20221010160436620-46e18af4.png",m="data:image/png;base64,",c="data:image/png;base64,",d="/assets/image-20221010160645531-1d2cfbaa.png",h="data:image/png;base64,",B="data:image/png;base64,",E="data:image/png;base64,",f="/assets/image-20221010161223188-e7d0b934.png",C="data:image/png;base64,",l="/assets/image-20221010161359586-f24380c4.png",Y="data:image/png;base64,",R="/assets/image-20221010161621915-133026e5.png",O="/assets/image-20221011133049832-8929f2b9.png",b="data:image/png;base64,",u="/assets/image-20221011133205535-ab0ea369.png",Q="/assets/image-20221011133258603-0eb92714.png",V="data:image/png;base64,",H="/assets/1665466577981-10-b250439d.png",x="/assets/1665466577977-1-11e8a446.png",U="data:image/png;base64,",F="data:image/png;base64,",N="data:image/png;base64,",P="data:image/png;base64,",w="data:image/png;base64,",D="/assets/1665466672083-31-c6af73fd.png",S="/assets/1665466672083-32-e674c266.png",I="/assets/1665466672083-33-d653c903.png",L="/assets/1665466672084-34-93f4fd0a.png",k="/assets/1665466672084-35-20b4b963.png",K="/assets/1665466672084-36-7495714d.png",J="/assets/image-20221011134325404-70f847f1.png",G="/assets/image-20221011134418756-01a1cac7.png",v="/assets/image-20221021142700005-11dcfbd3.png",z="/assets/image-20221021142742023-3bdbb00b.png",W={},M=a('<h1 id="模板管理" tabindex="-1"><a class="header-anchor" href="#模板管理" aria-hidden="true">#</a> 模板管理</h1><h2 id="表单字段" tabindex="-1"><a class="header-anchor" href="#表单字段" aria-hidden="true">#</a> 表单字段</h2><p>该模块是设置考生报名时所填写的报考信息，字段分为 <strong>系统字段</strong> 、<strong>特殊字段</strong>以及 <strong>自定义字段</strong></p><p><strong>系统字段</strong></p><p><img src="'+g+'" alt="image-20221010155343750"></p><p>系统字段包含了常用的一些字段，包括考生姓名，出生年月，最高学历，工作经历，教育经历等，系统字段不允许修改</p><p><strong>特殊字段</strong></p><p><img src="'+t+'" alt="image-20221010155414830"></p><p>特殊字段包括学信网在线验证码以及教师资格证证书号码</p><p><strong>自定义字段</strong></p><p><img src="'+e+'" alt="image-20221010155508084"></p><p>对于要使用的字段系统里没有时，需要创建自定义字段</p><p><strong>新增字段</strong></p><p>点击页面右上角的<img src="'+i+'" alt="image-20221010155609476">弹出以下窗口</p><p><img src="'+r+'" alt="image-20221010155629449"></p><p><strong>控件类型</strong></p><p><img src="'+o+'" alt="image-20221010155756041"></p><p><strong>字段名称</strong></p><p>填写中文名称的拼音首字母，不得与系统字段和其他自定义字段重复</p><p><strong>字段含义</strong></p><p>填写该字段的简要名称</p><p><strong>值</strong></p><p>在设置下拉列表，表格，单选项，多选项时需要提供选项让考生选择。选项用 <strong>“|”</strong> 分割，例如 <strong>男|女</strong></p><p><strong>字段说明</strong></p><p>对该字段的说明,一般显示在考生信息填写框下方</p><blockquote><p>自定义字段添加完成后，需要插入在指定考试中方可使用，具体方法见<strong>模板编辑</strong></p></blockquote><hr><h2 id="模板列表" tabindex="-1"><a class="header-anchor" href="#模板列表" aria-hidden="true">#</a> 模板列表</h2><h3 id="模板编辑" tabindex="-1"><a class="header-anchor" href="#模板编辑" aria-hidden="true">#</a> 模板编辑</h3><p>每个模板创建或者修改的时间可以在列表中查询到，最新创建和修改的显示在最上方</p><p><img src="'+n+'" alt="image-20221010160436620"></p><p>点击<img src="'+m+'" alt="image-20221010160454436">已删除的模版可以在此页面查看历史记录</p><p>点击<img src="'+c+'" alt="image-20221010160520915">进入模板编辑页面</p><p><img src="'+d+'" alt="image-20221010160645531"></p><p>左边是所有的系统字段和自定义字段，右边是当前选取的字段</p><p>在左边区域选取需要的字段，点击<img src="'+h+'" alt="image-20221010160723148">移入右边</p><p>同样，右边不想要的字段，选中后，点击<img src="'+B+'" alt="image-20221010160823773">移入左边</p><p>在右边，选中任一字段，点击<img src="'+E+'" alt="image-20221010160839222">可调整字段顺序</p><p>上传类字段需注意，必须上传文件需要勾选，非必须上传不勾选</p><blockquote><p>字段的前后顺序必须对应着报名考生填报信息时的字段顺序进行排序</p></blockquote><h3 id="模板克隆" tabindex="-1"><a class="header-anchor" href="#模板克隆" aria-hidden="true">#</a> 模板克隆</h3><p><img src="'+f+'" alt="image-20221010161223188"></p><p>点击<img src="'+C+'" alt="image-20221010161241147">按钮，会克隆出一个除用户名外一模一样的模板，用户只需要在克隆出来的木板上修改即可</p><blockquote><p>如需要创建新的模板，建议克隆其他模板，再进行修改</p></blockquote><h3 id="预览" tabindex="-1"><a class="header-anchor" href="#预览" aria-hidden="true">#</a> 预览</h3><p><img src="'+l+'" alt="image-20221010161359586"></p><p>点击任一模板中的<img src="'+Y+'" alt="image-20221010161542762">进入考生报名预览页面</p><p>页面中会按照模板编辑时选出的字段，按顺序列出报名考生需要填写的所有信息</p><p>具体页面截图如下</p><p><img src="'+R+'" alt="image-20221010161621915"></p><h3 id="报名表" tabindex="-1"><a class="header-anchor" href="#报名表" aria-hidden="true">#</a> 报名表</h3><p><img src="'+O+'" alt="image-20221011133049832"></p><p>在审核考生报名信息和对考生进行资格审查时需要用的表</p><p>点击<img src="'+b+'" alt="image-20221011133130454">进入设置页面</p><p><img src="'+u+'" alt="image-20221011133205535"></p><p>带&quot;{ }&quot;的英文代表考生所提交的字段值</p><p><strong>插入字段值</strong></p><p>点击</p><p><img src="'+Q+'" alt="image-20221011133258603"></p><p>选择需要插入的字段，在表格中点击确定需要插入的位置，点击<img src="'+V+'" alt="image-20221011133318550">即可插入该字段</p><p><strong>表格操作</strong></p><p>合并单元格：选中两个或以上单元格，点击</p><p><img src="'+H+'" alt="img"></p><p>即可合并单元格</p><p>拆分单元格：点击任一需要拆分的单元格，点击</p><p><img src="'+x+'" alt="img"></p><p>即可拆分</p><p>单元格居中：点击任一需要居中显示的单元格，点击</p><p><img src="'+U+'" alt="img"></p><p>即可将内容居中显示</p><p>向上插入行：点击你想插入行位置的下方单元格，点击</p><p><img src="'+F+'" alt="img"></p><p>即插入前行</p><p>向下插入行：点击你想插入行位置的上方单元格，点击</p><p><img src="'+N+'" alt="img"></p><p>即插入前行</p><p>向左插入列：点击你想插入行位置的右方单元格，点击</p><p><img src="'+P+'" alt="img"></p><p>即插入前列</p><p>向右插入列：点击你想插入行位置的左方单元格，点击</p><p><img src="'+w+'" alt="img"></p><p>即插入后列</p><p>删除整个表：选择表格，右键选择<strong>删除表格</strong>即可删除</p><p>删除行：选择你想删除的那一行，右键选择<strong>行-删除行</strong>即可删除</p><p>删除列：选择你想删除的那一列，右键选择<strong>列-删除列</strong>即可删除</p><p>调整边框</p><p><img src="'+D+'" alt="img"></p><p><img src="'+S+'" alt="img"></p><p><img src="'+I+'" alt="img"></p><p>设置好边框已经有改变，但是表格内单元格没有边框，进行下一步设置</p><p><img src="'+L+'" alt="img"></p><p><img src="'+k+'" alt="img"></p><p><img src="'+K+'" alt="img"></p><h3 id="准考证-面试单" tabindex="-1"><a class="header-anchor" href="#准考证-面试单" aria-hidden="true">#</a> 准考证/面试单</h3><p><img src="'+J+'" alt="image-20221011134325404"></p><p>考生参加笔试/面试时需携带的准考证，点击任一考试的准考证或面试单进入编辑页面</p><p><img src="'+G+'" alt="image-20221011134418756"></p><p>默认的笔试准考证含有，考生照片，准考证号，姓名，报考好，身份证号，报考岗位，考试时间，考场规则等</p><p>用户可根据需求自定义笔试/面试准考证</p><p>准考证模板设置可参照报名表</p><h3 id="体检单" tabindex="-1"><a class="header-anchor" href="#体检单" aria-hidden="true">#</a> 体检单</h3><p><img src="'+v+'" alt="image-20221021142700005"></p><p>考生参加体检时需携带的体检单，点击任一考试的体检单进入编辑页面</p><p><img src="'+z+'" alt="image-20221021142742023"></p><p>根据需要编辑体检单模板，完成后点击保存即可</p>',105),q=[M];function Z(j,T){return s(),p("div",null,q)}const y=A(W,[["render",Z],["__file","报名模板.html.vue"]]);export{y as default};
